BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS `tax_applied_to_account` (
	`id`	TEXT,
	`account_id`	TEXT,
	`payment_form_id`	TEXT,
	`fixed`	TEXT,
	`percentual`	TEXT
);
CREATE TABLE IF NOT EXISTS `payment_form` (
	`id`	TEXT,
	`name`	TEXT,
	`maximum_installments`	TEXT
);
CREATE TABLE IF NOT EXISTS `member` (
	`id`	TEXT,
	`name`	TEXT,
	`login`	TEXT,
	`enable`	TEXT,
	`last_name`	TEXT
);
CREATE TABLE IF NOT EXISTS `fixed_table_fee` (
	`id`	TEXT,
	`payment_form_id`	TEXT,
	`parcel_number`	TEXT,
	`fixed_tax_percentual`	TEXT,
	`parcel_tax_percentual`	TEXT,
	`fixed_tax_value`	TEXT
);
CREATE TABLE IF NOT EXISTS `channel_fixed_table_fee` (
	`id`	TEXT,
	`channel_id`	TEXT,
	`payment_form_id`	TEXT,
	`parcel_number`	TEXT,
	`fixed_tax_percentual`	TEXT,
	`parcel_tax_percentual`	TEXT,
	`fixed_tax_value`	TEXT
);
CREATE TABLE IF NOT EXISTS `channel` (
	`id`	TEXT,
	`name`	TEXT,
	`account_id`	TEXT
);
CREATE TABLE IF NOT EXISTS `accounts_channels` (
	`channel_id`	TEXT,
	`account_id`	TEXT
);
CREATE TABLE IF NOT EXISTS `account_payment_fee` (
	`id`	TEXT,
	`account_id`	TEXT,
	`payment_form_id`	TEXT,
	`fixed`	TEXT,
	`antecipation_percentage`	TEXT,
	`one_parcel`	TEXT,
	`between_two_and_six_parcels`	TEXT,
	`more_than_seven_parcels`	TEXT
);
CREATE TABLE IF NOT EXISTS `account_fixed_table_fee` (
	`id`	TEXT,
	`account_id`	TEXT,
	`payment_form_id`	TEXT,
	`parcel_number`	TEXT,
	`fixed_tax_percentual`	TEXT,
	`parcel_tax_percentual`	TEXT,
	`fixed_tax_value`	TEXT
);
CREATE TABLE IF NOT EXISTS `account` (
	`id`	TEXT,
	`status`	TEXT,
	`type`	TEXT,
	`fee_type`	TEXT,
	`has_bonus_withdraw`	TEXT,
	`v2_integration_level`	TEXT,
	`negotiated_tax`	TEXT,
	`is_transparent`	TEXT
);
COMMIT;
